import React, { useState } from 'react';

const App = () =>{

  let newTime = new Date().toLocaleTimeString();

  const[cTime, setCTime] = useState(newTime);

  const UpdatedTime = () =>{
    newTime = new Date().toLocaleTimeString();
    setCTime(newTime);
  }

  setInterval(UpdatedTime())

  return (
    <>
      <div>
        <h1>{cTime}</h1>
      </div>
    </>
  )
}

export default App;













